hexToPantone.prototype.getConfig = function(options){
  const config = Object.assign(options || {}, {
    distance: 256
  });

  this.validateConfig(config);

  return config;
}

hexToPantone.prototype.validateConfig = function(config){
  return config.hasOwnProperty(config.distance) && this.isValidDistance(config.distance);
};

hexToPantone.prototype.isValidDistance = function(distance){
  return [16, 32, 48, 64, 80, 96].indexOf(distance) !== -1;
};

hexToPantone.prototype.pmsToHex = function(pms){
  var i = this.pmsColorCodes.indexOf(pms);
  return (i !== -1 ) ? this.hexMatches[i] : '';
};

hexToPantone.prototype.hexToPms = function(hex){
  var i = this.hexMatches.indexOf(this.hex);
  return (i !== -1) ? this.pmsColorCodes[i] : '';
};
